import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { LoanApplication } from '../types';
import './ApplicationCompletePage.css';

const ApplicationCompletePage: React.FC = () => {
  const navigate = useNavigate();
  const [application, setApplication] = useState<LoanApplication | null>(null);

  useEffect(() => {
    const savedApplication = sessionStorage.getItem('application');
    if (savedApplication) {
      setApplication(JSON.parse(savedApplication));
    }
  }, []);

  const formatCurrency = (amount: number) => {
    return new Intl.NumberFormat('ja-JP').format(amount);
  };

  const formatDate = (dateString: string) => {
    return new Date(dateString).toLocaleString('ja-JP');
  };

  const getStatusLabel = (status: string) => {
    switch (status) {
      case 'PENDING': return 'ÂØ©Êüª‰∏≠';
      case 'APPROVED': return 'ÊâøË™çÊ∏à„Åø';
      case 'REJECTED': return 'Âç¥‰∏ã';
      case 'PROCESSING': return 'Âá¶ÁêÜ‰∏≠';
      default: return status;
    }
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'APPROVED': return 'success';
      case 'REJECTED': return 'error';
      case 'PENDING': return 'warning';
      default: return 'info';
    }
  };

  if (!application) {
    return (
      <div className="container">
